import React from "react";
import "./NavBar.css";

const NavBar = () => {
  return (
    <div id="bar">
      <input type="checkbox" id="ch" />
      <label for="ch" id="main"></label>
      <nav className="navbar">
        <a className="Links navbar-brand" href="#">
          .HOME()
        </a>
        <a className="Links navbar-brand" href="#">
          .ABOUT()
        </a>
        <a className="Links navbar-brand" href="#">
          .SKILLS()
        </a>
        <a className="Links navbar-brand" href="#">
          .CONTACT()
        </a>
      </nav>
    </div>
  );
};
export default NavBar;
